import React, { Component } from 'react';

class Classes extends Component {
  state = {};

  render() {
    return (
      <div className="classes">
        <div>
          <span style={{ fontSize: '25px', fontWeight: 500 }}>
            Classes
          </span>
        </div>
      </div>
    );
  }
}

export default Classes;
